    return (
        <div className="navbar-icons">
            {iconList.map((iconObj) => (
                <div
                    className={
                        iconObj.active ? "navbar-icon active" : "navbar-icon"
                    }
                    onClick={changeActive}
                    key={iconObj.id}
                >
                    <i className={iconObj.icon}></i>
                </div>
            ))}
        </div>
    );
}
